body.script:
function share() {
	const shareData = {
		title: 'The NPR Politics Podcast - Podcast Details',
		text: 'All the public stats of the podcast The NPR Politics Podcast',
		url: 'https://podcastdetails.com/?url=https://feeds.npr.org/510310/podcast.xml',
	}
	// if(typeof screen.orientation === 'undefined' && window.navigator && window.navigator.share) {
	// 	navigator.share(shareData);
	// 	return;
	// }
	if (window.navigator && window.navigator.share && window.navigator.canShare(shareData) && window.navigator.canShare(shareData) && typeof screen.orientation === 'undefined') {
		navigator.share(shareData);
	} else {
		window.location.href = 'https://wocial.com/?create=1&url='+encodeURIComponent('https://podcastdetails.com/?url=https://feeds.npr.org/510310/podcast.xml')+'&text='+encodeURIComponent('The NPR Politics Podcast - Podcast Details')+'';
	}
}
